Clone_of_New_Togg_2.query:
q = load "${App.Datasets.HLS_Task7_tp.FullyQualifiedName}";
q = filter q by 'CarePlan.IsClosed' == "false";
q_A = filter q by 'IsOverdue' == "true";
q_B = filter q by 'IsOverdue' == "false";
result = group q_A by '{{column(Static_New_1.selection,["Dimension2"]).asObject()}}' full, q_B by '{{column(Static_New_1.selection,["Dimension2"]).asObject()}}';
result = foreach result generate coalesce(q_A.'{{column(Static_New_1.selection,["Dimension2"]).asObject()}}', q_B.'{{column(Static_New_1.selection,["Dimension2"]).asObject()}}') as '{{column(Static_New_1.selection,["Dimension2"]).asObject()}}', unique(q_A.'CarePlan.AccountId') as 'A', unique(q_B.'CarePlan.AccountId') as 'B';
result = foreach result generate '{{column(Static_New_1.selection,["Dimension2"]).asObject()}}', 'A', 'B', coalesce(A,0) as 'offTrack', coalesce(B,0) as 'onTrack';
result = order result by ('{{column(Static_New_1.selection,["Dimension2"]).asObject()}}' asc);
result = limit result 2000;
